  <script>
    $(document).ready(() => {
      let distance = $('#deepbrown').offset().top;
      let $window = $(window);

      $window.scroll(function () {
        if ($window.scrollTop() < distance) {
          document.documentElement.style.setProperty('--text-color', '#000000');
          document.documentElement.style.setProperty('--wave-bg', 'rgb(255,239,119)');
          document.documentElement.style.setProperty('--wave-fill', 'rgb(170,196,206)');
        }
        if ($window.scrollTop() >= distance) {
          document.documentElement.style.setProperty('--text-color', '#ffffff');
          document.documentElement.style.setProperty('--wave-bg', '#000000');
          document.documentElement.style.setProperty('--wave-fill', '#0000ff');
        }
      });
    })
